      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "aQKIRehXbpOdXdNDPjhcnprNtbE",
          "id": "UgxpXP4vEU1Kqjnzl1J4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Time is constant, Even when gravity is high, the time remains constant, its just the our moment gets affected and how things move due to high gravity but that doesn't mean time gets slower. Time is always constant.\n\nIn interstellar movie explained that 1 hour on the other world is 7 years of earth time.\nThat is complete bullshit, its just the moment we make gets affected but time remains the same, what we are thinking is that earth movement  is a correct time and when only comparing earth gravity to other planet gravity , you are saying time is dilated and changes.\n\nBut what i am saying is that dont consider earth gravity movement as our TIME , the change happening is just in the movement we make and not any change in Time.",
            "textOriginal": "Time is constant, Even when gravity is high, the time remains constant, its just the our moment gets affected and how things move due to high gravity but that doesn't mean time gets slower. Time is always constant.\n\nIn interstellar movie explained that 1 hour on the other world is 7 years of earth time.\nThat is complete bullshit, its just the moment we make gets affected but time remains the same, what we are thinking is that earth movement  is a correct time and when only comparing earth gravity to other planet gravity , you are saying time is dilated and changes.\n\nBut what i am saying is that dont consider earth gravity movement as our TIME , the change happening is just in the movement we make and not any change in Time.",
            "authorDisplayName": "Francis Geovanni",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AGIKgqMstpq40GBeiE2MqRtzjDDtz4QG3uNeyAIwjAXp=s48-c-k-c0x00ffffff-no-rj",
            "authorChannelUrl": "http://www.youtube.com/channel/UC9wcLsvYF9zMe2R-TtQYvzg",
