      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "h14BvO9CC7BxOyoFHhft-8x5a7g",
          "id": "Ugx4d_QXHah6L2e9olx4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "I'll never understand this.  Still doesn't make sense.  Person A on earth has a timex watch and Person B in space , travelling at the speed of light also has a timex watch.   Both are ticking at the same time.... : | ...what would cause it to tick slower? low battery?  And don't tell me \"dont think of time that way--as clocks ticking\" ...i still don't get this",
            "textOriginal": "I'll never understand this.  Still doesn't make sense.  Person A on earth has a timex watch and Person B in space , travelling at the speed of light also has a timex watch.   Both are ticking at the same time.... : | ...what would cause it to tick slower? low battery?  And don't tell me \"dont think of time that way--as clocks ticking\" ...i still don't get this",
