    {
      "kind": "youtube#commentThread",
      "etag": "hP9-xGSBbIFBc9SePBwfzJ4bpjs",
      "id": "UgzFrZvwlW-E7BBrgOJ4AaABAg",
      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "mIa1bhSRhsjAYLTyzwtYm332IRM",
          "id": "UgzFrZvwlW-E7BBrgOJ4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Let's say you drove a car filled with 5 gallons of gas on a planet near a black hole. Then you drive the same car with the same amount of gas here on earth. Would the two cars travel the same distance in the same amount of time? I'm thinking yes. However we here on earth would measure it taking a lot longer for the same car to complete the trip and the observers near the black hole would see the car back on earth finish the same trip in a split second? More time is needed for the car near the black hole to travel across the curved spacetime. Time has to slow down to make up for the extra distance needed to travel?",
